public class Solution {
    public int MinimumOperationsToMakeEqual(int x, int y) {
        if (x == y) return 0;
        int operations = 0;
        while (x != y) {
            if (x < y) {
                operations += y - x;
                break;
            } else {
                if (x % 11 == 0 && x / 11 >= y) {
                    x /= 11;
                } else if (x % 5 == 0 && x / 5 >= y) {
                    x /= 5;
                } else if (x - 1 >= y && ((x - 1) % 11 == 0 || (x - 1) % 5 == 0)) {
                    x--;
                } else if (x > y) {
                    int diff = x - y;
                    if (diff % 2 == 0 || (diff < 10 && x % 5 != 0 && x % 11 != 0)) {
                        x--;
                    } else {
                        x++;
                    }
                }
            }
            operations++;
        }
        return operations;
    }
}
